    "narrative": "The Great Galveston Hurricane of 1900 remains the deadliest natural disaster in United States history. Making landfall on September 8, 1900, as a Category 4 hurricane with sustained winds of 145 mph and a minimum pressure of 936 mb, the storm brought a catastrophic 15-20 foot storm surge that completely inundated Galveston Island. Between 8,000 and 12,000 people lost their lives, with entire neighborhoods swept away by the surge. The hurricane destroyed over 3,600 buildings and left the once-thriving port city in ruins. The disaster led to the construction of the Galveston Seawall and the raising of the entire city by as much as 17 feet, forever changing how coastal communities prepare for hurricanes.",
